  false,\n\t\"url\": null,\n\t\"notes\": \"The Groundfish SAFE Economic Report, published
  annually as a supplement to the Stock Assessment and Fishery Evaluation Reports
  for Bering Sea and Aleutian Islands and Gulf of Alaska groundfish, summarizes economic
  information about the federal groundfish fisheries off Alaska. The Economic Report
  includes a core set of tables summarizing catch, discards and bycatch; ex-vessel
  value and price; wholesale production, value, and price; fishery participation by
  small entities; and fishing effort.\",\n\t\"owner_org\": \"e811f0b4-451f-4896-9e8f-fc6802837819\",\n\t\"extras\":
